import React from "react";
import Children from "./Items";
import "./App.css"
import info from "./info";
class App extends Component {
  constructor(){
    super();
    this.state = {
      arr:info
    }
  }
  filtering(array){
    const newarray = array.filter(function(e){return e.age<30})
    return newarray
  } 

  mapping(array){
    const newarray = array.map(e=><Children 
                            key={e.id}
                            f_name={e.f_name}  
                            l_name={e.l_name}  
                            age={e.age} 
                            email={e.email} 
                            user_name={e.user_name} 
                          />)
    return newarray
  }

  render(){    
    return (
      <div className="App">
          {this.mapping(this.filtering(this.state.arr))}
      </div>
    );
  }
}

export default App;
